import SecondHeader from '../components/SecondHeader';

const PlayerDetailsPage = ({ player, navigateToPage }) => {
  if (!player) return <div>لا يوجد لاعب محدد</div>;

  return (
    <div className="min-h-screen">
      <SecondHeader navigateToPage={navigateToPage} showBackButton={true} />
      <div className="p-6">
        <h1 className="text-2xl font-bold mb-4">{player.name}</h1>
        <div className="bg-white p-4 rounded-lg shadow">
          <p>النادي: {player.team}</p>
          <p>العمر: {player.age}</p>
          <p>نسبة النجاح: {player.successRate}%</p>
          <p>عدد المباريات: {player.matches}</p>
          <p>التقييم: {player.rating}</p>
          <p>توزيع ناجح: 88%</p>
          <p>تصديات/مباراة: 3.8</p>
          <p>نسبة الإنقاذ: 82%</p>
        </div>
      </div>
    </div>
  );
};

export default PlayerDetailsPage;
